import React,{Component} from 'react';
import {View,Text,StyleSheet,ImageBackground, Alert}from 'react-native';
import { Icon,Card,Button} from 'react-native-elements';
import *as firebase from 'firebase';
import { FlatList } from 'react-native-gesture-handler';
export default class vehicle extends Component{
    constructor(props)
    {
        super(props);
       this.state={
           num:[]
       }
    }
    componentDidMount(){
         const id=this.props.navigation.navigate('id','');
         firebase.database().ref(`/Users/`).on('value',snap=>{
           snap.forEach(data=>{
               data.forEach(dataa=>{
                   dataa.forEach(num=>{
                    num.forEach(da=>{
                    if(da.key==='VehicleRegistration')
                    {
                        var data = Array.apply(null, {length: 20}).map(Number.call, Number);
                        let register={
                            id:data,
                            registerNum:da.val()
                        }
                            this.state.num.push(register)
                    }
                    })
                   })
               })
           })

         })
        // firebase.database().ref(`/Users/${id}/ownerDetails/VehicleRegistration`).on('value',snap=>{
        //     this.setState({num:snap.key()})
        //  }) 
    }
    static navigationOptions={
        title:'Your Vehicle'
    }
    render(){

        return(
            <ImageBackground source={require('../../assets/road.jpg')} style={styles.image}>
                <View style={styles.container}>
        <Text style={{color:'white'}}>{this.state.num}</Text>
            <FlatList
            data={this.state.num}
            renderItem={({item,index})=>{
                <Card>
                 <Text>
                     {item.registerNum}
                     </Text></Card>       


            }}
            keyExtractor={(item)=>item.id.toString()}
            />
             </View>
                </ImageBackground>
        )}
}
const styles=StyleSheet.create({
    image:{
        flex:1,
        resizeMode:'cover',
        justifyContent:'center',
        alignItems:'center'
    },
    container:{
        flex:1,
        justifyContent:'center'
    }
})
